import React from "react";
import Header from "../components/Header";
import SideBar from "../components/SideBar";

function Layout({ children }) {
    return (
        <div cl>
            <Header />
            <div>
                <SideBar />
                <div>{children}</div>
            </div>
        </div>
    )
}

export default Layout;
